import React from 'react';
import { Source } from './Buttons';


const styles = {
  rootDiv: {
    boxShadow: '0px 8px 20px 8px rgba(0,0,0,0.6)',
    position: 'relative',
    marginLeft: 0,
    marginRight: 0,
    marginBottom: '1.5vh',
    borderRadius: 10
  },
  title: {
    // fontShadow: '0px 8px 20px 8px rgba(0,0,0,0.6)',
    fontSize: '3em',
    fontFamily: "'Poiret One', cursive",
    fontWeight: '900',
    marginLeft: '2vw',
    marginTop: '1vw'
  },
  p: {
    fontSize: '1em',
    fontFamily: "'Poiret One', cursive",
    fontWeight: '600',
    color: 'white'
  }
};

const Footer = () => {
  return (
    <footer style={styles.rootDiv}>
      <div class="row">
        <div class="col-12">
          <h1 style={styles.title}>"Footer"</h1>
        </div>
      </div>
      <div class="row justify-content-center">
        <div class="col-10 content-justify-center" align='center'>
        <Source />
        <p style={styles.p}>
            Images thanks to Niki Moshe
          </p>
          <p style={styles.p}>
            Images thanks to Niki Moshe
          </p>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
